void HexToBin(uint8_t hex_number,uint8_t* bit_number)
{
    int max = 128;
    for(int i = 0 ; i <8 ; i++){
        bit_number [i] = (hex_number & max ) ? 1 : 0;
        max >>=1;
    }
}

